import React from 'react';
import styled from 'styled-components';
import ParagrafMain from './ParagrafMain.js'
import './Cards.css';
import SubTitles from '../SubTitle.js';


const Card = styled.div`
    width: 420px;
    height: 125px;
    padding:35px 40px;
    margin:40px 20px 0 0;
    box-shadow: 0 2px 8px rgba(0,0,0,.15);
    text-align: center;
    z-index: 0;

    p{
        font-size: 15px;
    }


`
const TitleBox = styled.div`
    display: flex;

    h3{
        font-size: 15px;
        text-transform: uppercase;
    }
    .Date {
        color: #8898AA;

    }
    .Mission {
        color: #32325D;
    }
`



class Cards extends React.Component{
    render(){
        return(
            <Card className="hover ">
                <TitleBox><SubTitles className="Mission" title="terminal"/> <SubTitles className="Date" title="september 23"/></TitleBox>
                <ParagrafMain text="Platforms can now export connected account information as a CSV from the Dashboard."/>
            </Card>
        );
    }

}

export default Cards;
